import './card.css'

function Card({title, index, titleButton, textList, nameImage}){
    return(

        <div className='card'>

            <div className='header-card' style={{backgroundImage: `url("./assets/image8.png")`}}>
                <div className='number-index'>{index}</div>
                <h2>{title}</h2>
            </div>

            <div className='container-text'>
                {textList.map((text, index) => <p key={index}>{text}</p>)}
            </div>

            <button>{titleButton}</button>

        </div>
    );
}

export default Card;
